Row.code:

var sessionQueryParam = "wt.effectiveUid"; // Only applicable when the windchill connector is used without any media entity connector.

var Language = Resources["CurrentSessionInfo"].GetCurrentUserLanguage();

var params = {
    infoTableName: "InfoTable",
    dataShapeName: "NavigateCustomHeadersDataShape"
};
var result = Resources["InfoTableFunctions"].CreateInfoTableFromDataShape(params);
var CurrentUser;


params = {
    tableName: "GenericConnectorConnectionSettings" /* STRING */
};
var configTable = me.GetConfigurationTable(params);

var row = configTable.getRow(0);
var authType = row.getStringValue("AuthenticationType");


if ("None".equals(authType.trim())) {
    try {
        sessionQueryParam = me.GetSessionUserQueryQarameter();

        var idpAuthenticator = Authenticators["ptc-identity-provider-authenticator"];


        params = {
            tableName: "AuthenticatorConfiguration" /* STRING */
        };
        var multiIdp = idpAuthenticator.GetConfigurationTable(params).getFirstRow().getValue("MultipleWindchillServers");
        if (multiIdp) {
            params = {
                tableName: "HTTPConnectorConnectionSettings" /* STRING */
            };

            configTable = me.GetConfigurationTable(params);
            row = configTable.getRow(0);
            var serverUrl = row.getStringValue("BaseURL");
            var n = serverUrl.indexOf('Windchill/');
            serverUrl = serverUrl.substring(0, n != -1 ? n + 10 : serverUrl.length);
            //TODO valdiate serverUrl

            var asserionProp = Resources["CurrentSessionInfo"].GetGlobalSessionValues().getFirstRow().getValue("AssertionPairs");
            var tableLength = asserionProp.rows.length;
            for (var x = 0; x < tableLength; x++) {
                var assertRow = asserionProp.rows[x];
                var assertedServer = assertRow.getValue("Server");
                if (assertedServer.localeCompare(serverUrl) === 0) {
                    CurrentUser = assertRow.getValue("Assertion");
                    break;
                }
            }

        } else {
            CurrentUser = Resources["CurrentSessionInfo"].GetCurrentUser();
        }



    } catch (err) {
        logger.error(err);
    }

    if (CurrentUser === undefined) {
        logger.error("no assertion to user: " + Resources["CurrentSessionInfo"].GetCurrentUser() + " for server: " + serverUrl);
    }

    var camelHttpQuery = sessionQueryParam + "=" + CurrentUser;
    row = {
        "Accept-Language": Language,
        "CamelHttpQuery": camelHttpQuery
    };
} else {
    row = {
        "Accept-Language": Language
    };
}

result.AddRow(row);
